import React from 'react'
import {AppBar, Toolbar, Typography, Button} from '@material-ui/core';

function TitleBar() {
	return (
		<AppBar position="static">
		    <Typography variant="h5">
		      Welcome to Omniscient
		    </Typography>
		</AppBar>
	)
}

export default TitleBar;
